import logo from './logo.svg';
import './App.css';
import Login from './components/login';
import Logout from './components/logout';
import { useEffect } from 'react';
import { gapi } from 'gapi-script';

const CLIENT_ID = "447618393940-7jd24vhgh4b0hd7n44civpf270k060i8.apps.googleusercontent.com";
const API_KEY = 'AIzaSyDuIrqYbiM8dKwRGgAZz-fVs9Sn1Vhtbrg';

function App() {

  useEffect(() => {
    function start() {
      gapi.auth2.init({
        apiKey: API_KEY, 
        clientId: CLIENT_ID, 
        scope: ""
      })
    };

    gapi.load('client:auth2', start);
  });

  return (
    <div className="App">
     <Login/>
     <Logout/>
    </div>
  );
}

export default App;
